func startBenchServer(b *testing.B, res any) *httptest.Server {
	b.Helper()
	mux := http.NewServeMux()
	mux.HandleFunc("POST /bench", func(w http.ResponseWriter, r *http.Request) {
		w.Header().Set("Content-Type", "application/json")
		w.WriteHeader(http.StatusOK)

		_ = json.NewEncoder(w).Encode(res)
	})
	server := httptest.NewServer(mux)
	b.Cleanup(server.Close)
	return server
}

func BenchmarkRestyClientWithJsonSmall(b *testing.B) {
	body := smallBody{
		FirstName: "John",
		LastName:  "Doe",
		Email:     "john.doe@email.com",
		Age:       30,
	}
	server := startBenchServer(b, body)
	client := resty.New().
		SetBaseURL(server.URL).
		AddContentTypeEncoder("application/json", func(w io.Writer, v any) error {
			enc := json.NewEncoder(w)
			return enc.Encode(v)
		}).
		AddContentTypeDecoder("application/json", func(r io.Reader, v any) error {
			dec := json.NewDecoder(r)
			return dec.Decode(v)
		}).
		SetHeader("Content-Type", "application/json")
	defer client.Close()

	for b.Loop() {
		_, _ = client.NewRequest().SetBody(body).Post("/bench")
	}
}

